package module1;

public class EvenNumbers {

	public static void main(String[] args) {
		
		// TODO Auto-generated method stub
		/*Author:Gayathri B Nair
		 * Date:17/07/2025
		 */
		
		int i=2;
		System.out.println("Even numbers between 1 and 20");
		do
		{
			System.out.println(i+" ");
			i+=2;
		}while(i<20);
	}

}
